import React from "react";
import map from "../images/worldmap.png";
 import pin from "../images/pin.svg"
 import yellow from "../images/yellow.png"
 import img2 from "../images/lucas-5tRmLGguL3Q-unsplash.jpg";
import "./Contactus.css";
function Contactus() {
  function anim() {
    let on = document.getElementById("anime");
    on.classList.add("boxxcontent1");
  }
  function anim2() {
    let on = document.getElementById("anime");
    on.classList.remove("boxxcontent1");
  }
  return (
    <div >
      <div class="mobileboxx">
       <div class="mobileboxximg">
        <img class="teacherimg" src={img2} alt="Avatar" />
        <button class="cliq" onClick={anim}>
            Click me
          </button>
       </div>
       <div class="revealedata">      
        <div class="boxxcontent" id="anime">
            <h1>are you student?</h1>
            <button onClick={anim2}>Back</button>
          </div>
        </div>
       <div class="mobileboxximg"> <img class="studentimg"  src={img2} alt="Avatar" /></div>
       <div class="mobileboxximg">       <img class="parentimg"  src={img2} alt="Avatar" /></div>
      </div>
      <div class="world-map">
        <img src={map} alt=""></img>
     <div class="class1"><div class= "blink"></div><span class="india">Mumbai,India</span></div> 
      </div>
       <div>
 <img src={pin} alt=""></img>
 <img class="yellow" src={yellow} alt=""></img>
       </div>
        {/* <img src={pin} alt=""> </img> */}
    </div>
  );
}
export default Contactus;
